INSERT INTO store_category VALUES(1,'Vetements','Catégorie de vêtements comprenant une variété de styles, de tailles et de designs.',1,0);
INSERT INTO store_category VALUES(2,'Chaussures','Catégorie de chaussures comprenant des chaussures pour hommes, femmes et enfants dans différents styles et tailles.',1,0);
INSERT INTO store_category VALUES(3,'Accessoires','Catégorie d''accessoires comprenant des articles tels que des sacs, des bijoux, des ceintures et plus encore.',1,0);
INSERT INTO store_category VALUES(4,'Électronique','Catégorie d''électronique comprenant une large gamme de produits tels que des téléphones, des ordinateurs, des appareils audio et plus encore.',1,0);
INSERT INTO store_category VALUES(5,'Alimentation','Catégorie d''alimentation comprenant des produits alimentaires de différentes catégories, des produits frais aux produits emballés.',1,0);
INSERT INTO store_category VALUES(6,'Santé et beauté','Catégorie de santé et de beauté comprenant des produits de soins personnels, de maquillage, de soins de la peau et plus encore.',1,0);
INSERT INTO store_category VALUES(7,'Maison et jardin','Catégorie de maison et de jardin comprenant des articles pour la maison tels que des meubles, des décorations, des ustensiles de cuisine et plus encore.',1,0);
INSERT INTO store_category VALUES(8,'Sports et loisirs','Catégorie de sports et de loisirs comprenant des articles liés aux sports, aux activités de plein air, aux jeux et plus encore.',1,0);
INSERT INTO store_category VALUES(9,'Livres et médias','Catégorie de livres et de médias comprenant une variété de livres, de films, de musique et de contenu multimédia.',1,0);
INSERT INTO store_category VALUES(10,'Autres','Catégorie pour les articles qui ne rentrent pas dans les catégories précédentes, offrant une diversité d''options.',1,0);
INSERT INTO store_product VALUES(1,'Converse','1_Co',140.0,42,'Soyez prêt à impressionner avec ces chaussures élégantes. Fabriquées à partir de cuir véritable et dotées d''une semelle en caoutchouc résistante, ces chaussures allient confort et style pour toutes les occasions.','img/4.jpg',2);
INSERT INTO store_product VALUES(2,'Air Jordan 2','2_Ai',450.0,75,'Découvrez le summum du confort avec nos nouvelles baskets légères. Leur semelle intérieure ergonomique et leur design aéré garantissent une marche sans effort, que ce soit pour une randonnée en plein air ou une journée en ville','img/6.jpg',2);
INSERT INTO store_product VALUES(3,'NovaFlex','None_No',449.99000000000000908,24,'Les chaussures de randonnée ultimes pour les aventuriers intrépides. Leur construction résistante à l''eau et leur semelle crantée offrent une adhérence supérieure sur les terrains les plus difficiles, vous permettant d''explorer la nature en toute confiance.','img/5.jpg',2);
INSERT INTO store_product VALUES(4,'RetroChic','None_Re',249.9900000000000091,42,'Faites sensation à chaque pas avec ces talons hauts en cuir verni. Leur design élégant et leur couleur vive ajoutent une touche de glamour à vos tenues de soirée, attirant tous les regards sur vous','img/2.jpg',2);
