BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);

CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);

CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "accounts_shopper" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "accounts_shopper_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "shopper_id" bigint NOT NULL REFERENCES "accounts_shopper" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_shopper_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "shopper_id" bigint NOT NULL REFERENCES "accounts_shopper" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "accounts_shopper" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "store_order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "payment_details" real NOT NULL, "order_date" date NULL, "status" bool NOT NULL, "client_id" bigint NOT NULL REFERENCES "accounts_shopper" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "store_product" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "product_name" varchar(45) NOT NULL, "reference" text NOT NULL, "price" real NOT NULL, "stock" integer NOT NULL, "description" text NOT NULL, "image" varchar(100) NULL, "category_id" bigint NOT NULL REFERENCES "store_category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "store_orderdetail" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" varchar(45) NULL, "unit_price" varchar(45) NULL, "order_id" bigint NOT NULL REFERENCES "store_order" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NOT NULL REFERENCES "store_product" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "store_invoicedetail" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "unit_price" integer NOT NULL, "quantity" integer NOT NULL, "invoice_id" bigint NOT NULL REFERENCES "store_invoice" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "store_invoice" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "total_amount" varchar(45) NULL, "invoice_date" date NULL, "order_id" bigint NOT NULL REFERENCES "store_order" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "store_cart" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "total_price" real NULL, "client_id" bigint NOT NULL REFERENCES "accounts_shopper" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "store_cart_orders" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cart_id" bigint NOT NULL REFERENCES "store_cart" ("id") DEFERRABLE INITIALLY DEFERRED, "order_id" bigint NOT NULL REFERENCES "store_order" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "store_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "category_name" varchar(45) NOT NULL, "description" text NOT NULL, "show" bool NOT NULL, "productLen" integer NOT NULL);
